import React from "react";

function PlayerSection(props) {
    if (Array.isArray(props.scores)) {   
        return (
            <table>
                <thead>
                <tr>Player</tr>
                <tr>Scores</tr>
                </thead>
                <tbody>
                    {props.scores.map((item) => {
                        return (
                        <tr>
                            <td>{item[0]}</td>
                            <td>{item[1]}</td>
                        </tr>
                        );
                    })}
                </tbody>
            </table>
        );
    } else {
        return(<p>NOT ARRAY</p>);
    }
};
export default PlayerSection;
